import React from 'react';
import Link from '../link/Link';
import './navbar.css';

class Navbar extends React.Component {
    render() {
        return(
            <React.Fragment>
                <div className='menu-icon'>
                    <i className='fa fa-bars fa-2x'></i>               
                </div>
                <div className='logo'>Logo</div>
                <div className='menu'>
                    <ul>
                        <li><Link /></li>
                        <li><Link /></li>
                        <li><Link /></li>
                        <li><Link /></li>
                    </ul>
                </div>
            </React.Fragment>
        ) 
    }
}

export default Navbar;
